comment:
예상보다 기본 높이가 높아서 손목 받침대가 필요합니다. 장시간 사용하니 손목이 아파요..
가벼운 키감을 써본 적이 없어서 무슨 뜻인지 몰랐는데 이 제품으로 깨닫게 되었습니다. 저는 조금 더 누르는 맛이 있는, 무게감이 있는 키보드와 더 잘 맞아요. 키감이 가볍다보니 오타가 좀 납니다; 대신 누르는데 힘이 덜 들어가서 손가락은 덜 아픕니다. 치는 속도도 빠르고요. 단지 손목이 좀 아프고 오타가 좀 날 뿐이죠..;
전체적으로, 문서작업보다는 게임에 훨씬 더 특화되어있는 키보드라 느꼈습니다.

반응속도 리겜하기에 너무 안좋고 as 회수도 안오네요...
리겜하시는 분들 사지 마세요 반응속도 측정 사이트에서 테스트해보니까 20ms 나오고 리겜할때 키도 잘 씹힙니다. 진짜 리겜하는분들은 사지 마세요 리겜할때 독약이에요;;
근데 키보드는 이쁘당
